INSERT INTO `T_TRADUCTION_LIBELLE` VALUES (1590,'ar','أوطابوعبان'),(1590,'fr','OUTABOUABANE'),(1591,'ar','تازة'),(1591,'fr','TAZA'),(1592,'ar','تدبير النظام'),(1592,'fr','Gestion du système'),(1593,'ar','تدبير الإدارة'),(1593,'fr','Gestion de l\'organisation'),(1594,'ar','تدبير المؤسسات'),(1594,'fr','Gestion de l\'établissement'),(1595,'ar','حي الرياض'),(1595,'fr','Hay RIAD'),(1596,'ar','التجارب'),(1596,'fr','DEMONSTRATIONS'),(1597,'ar','منصة للتجارب'),(1597,'fr','PLATEFORME POUR LES DÉMONSTRATIONS'),(1598,'ar','مرحبا بكم في بوابة أخذ المواعيد'),(1598,'fr','Bienvenue sur l\'application de prise de rendez-vous'),(1599,'ar','من أجل خدمة أفضل،نضع رهن إشارتكم نظاما رقميا لإدارة المواعيد والذي يمكنكم من أخذ مواعيد عبر الأنترنت أو الهاتف \r\n<br /><br />\r\nهذا النظام الرقمي يعفيكم من كثرة التنقلات و من النفقات المترتبة عنها و بالتالي يمكنكم من الاستغلال الأمثل لوقتكم و لطاقتكم \r\n <br /><br />'),(1599,'fr','Pour mieux accueillir nos patients, nous avons mis en place un système informatisé de consultation par internet. Grâce à ce service, vous pouvez prendre un rendez-vous avec l\'un de nos médecins et le consulter via notre plateforme sécurisée de visio-conférence.\r\n<br /><br />\r\n'),(1600,'ar','وكيل'),(1600,'fr','Agent'),(1601,'ar','مسؤول نظام'),(1601,'fr','Administrateur système'),(1602,'ar','ADD'),(1602,'fr','ADD'),(1603,'ar','UM6SS'),(1603,'fr','UM6SS'),(1604,'ar',''),(1604,'fr',''),(1605,'ar','شارع محمد الخامس'),(1605,'fr','Avenue Mohamed V'),(1606,'ar','وزارة التجهيز والنقل واللوجيتيك والماء'),(1606,'fr','MINISTÈRE DE L\'EQUIPEMENT, DU TRANSPORT, DE LA LOGISTIQUE ET DE L\'EAU'),(1607,'ar','وزارة التجهيز والنقل واللوجيتيك والماء هي الجهة الحكومية المسؤولة في الحكومة المغربية لضمان حسن سير قطاع لتجهيز والنقل واللوجيتياك والماء في جميع أنحاء المملكة'),(1607,'fr','Le ministère de l\'équipement, du transport, de la logistique et de l\'eau est le département ministériel du gouvernement marocain chargé de veiller au bon fonctionnement du secteur de l\'équipement, du transport, de la logistique et de l\'eau à travers le royaume'),(1608,'ar','موقع الوزارة'),(1608,'fr','Site du ministère'),(1609,'ar','شكاية'),(1609,'fr','Réclamation'),(1610,'ar',''),(1610,'fr',''),(1611,'ar','من أجل خدمة أفضل، تضع وزارة التجهيز والنقل واللوجيتيك والماء رهن إشارتكم نظاما رقميا لإدارة المواعيد والذي يمكنكم من أخذ مواعيد عبر الأنترنت أو الهاتف \r\n<br /><br />\r\nهذا النظام الرقمي يعفيكم من كثرة التنقلات و من النفقات المترتبة عنها و بالتالي يمكنكم من الاستغلال الأمثل لوقتكم ولطاقتكم'),(1611,'fr','Pour mieux accueillir ses usagers, le Ministère de l\'équipement, du transport, de la logistique et de l\'eau a mis en place un système informatisé de gestion des rendez-vous, qui leur permet de prendre rendez-vous par internet ou par téléphone  \r\n<br /><br />\r\nCe service vous permet de réduire le nombre des déplacements\r\n<br /><br />\r\nCe service vous permet de réduire les frais liés aux déplacements\r\n<br /><br />\r\nCe service vous garanties une optimisation de votre temps et de votre énergie\r\n<br /><br />'),(1612,'ar',' مرحبا بكم في بوابة أخذ المواعيد بوزارة التجهيز والنقل واللوجيتيك والماء'),(1612,'fr','Bienvenue sur l\'application de prise de rendez-vous auprès du Ministère de l\'équipement, du transport, de la logistique et de l\'eau.'),(1613,'ar','Admin'),(1613,'fr','Admin'),(1614,'ar','DEMO'),(1614,'fr','DEMO'),(1615,'ar','Administrateur d\'organisation'),(1615,'fr','Administrateur d\'organisation'),(1618,'ar','Admin'),(1618,'fr','Admin'),(1619,'ar','MTPNET'),(1619,'fr','MTPNET'),(1620,'ar','DIRECTION DES ROUTES, RABAT'),(1620,'fr','DIRECTION DES ROUTES, RABAT'),(1621,'ar','DIRECTION DES ROUTES'),(1621,'fr','DIRECTION DES ROUTES'),(1622,'ar',''),(1622,'fr',''),(1626,'ar','DIRECTEUR'),(1626,'fr','DIRECTEUR'),(1627,'ar','DIRECTEUR'),(1627,'fr','DIRECTEUR'),(1628,'ar','Enceinte Portuaire Bâtiment de la Capitainerie, 2ème étage Port de Casablanca, 20000 Casablanca, Maroc'),(1628,'fr','Enceinte Portuaire Bâtiment de la Capitainerie, 2ème étage P