 l’autonomie financière qui assure une double mission sociale et financière. De par sa mission sociale, la Caisse gère les régimes de pensions suivants :\r\n\r\n·       le régime des pensions civiles (fonctionnaires de l’Etat, agents des collectivités locales et de certains établissements publics) ;\r\n\r\n·        le régime des pensions militaires (Forces Armées Royales et Forces Auxiliaires);\r\n\r\n·        le régime de retraite complémentaire  ATTAKMILI ;\r\n\r\n·        les régimes non cotisants de pensions (pensions d’invalidité, allocations des Anciens Résistants et Anciens Membres de l’Armée de Libération).'),(3782,'ar','موقع الصندوق المغربي للتقاعد '),(3782,'fr','Site de la CMR'),(3783,'ar',''),(3783,'fr',''),(3784,'ar',''),(3784,'fr',''),(3785,'ar','في ظل حالة الطوارئ الصحية التي تعرفها بلادنا، ومن أجل ضمان الاستمرار في تقديم خدمات ذات جودة عالية لمرتفقيه وزواره يوفر لكم الصندوق المغربي للتقاعد خدمتي استقبال بالموعد وذلك عبر آليتين إثنتين:\r\n\r\n<br /><br /><b> - \r\n\r\nالاستقبال عن طريق الحضور الشخصي: </b> تتيح هذه الخدمة إمكانية أخذ موعد مسبق في أحد فضاءات الاستقبال التابعة للصندوق المغربي للتقاعد، سواء بالمقر الرئيسي بالرباط أو المندوبيات الجهوية، مع الموظف المكلف بالاستقبال والتوجيه وذلك حسب التاريخ والتوقيت الذي يناسبكم.\r\n\r\n<br /><br /> - \r\n<b>\r\nالاستقبال عن بعد: </b> تمكنكم هذه الخدمة المبتكرة،من التواصل عن بعد، عن طريق تقنية الفيديو، من بيتكم، مع الموظف المكلف بالاستقبال والتوجيه للاستفسار عن كل ما يخص ملفاتكم.\r\n<br /><br />'),(3785,'fr','Dans le contexte particulier de l’état d’urgence sanitaire, et afin de pouvoir continuer à vous assurer un service de qualité, la <span style=\"white-space: nowrap;\"><b>Caisse Marocaine des Retraites</b></span> vous offre deux services d’accueil sur Rendez –Vous :\r\n\r\n<br /><br /><b> - Accueil en présentiel :</b> ce dispositif vous permet de prendre rendez-vous dans l’un des espaces d’accueil de la CMR (siège et délégations régionales) avec un chargé d’information et de conseil selon votre disponibilité à la date et heure de votre convenance.\r\n\r\n<br /><br /><b> - Accueil par visio conférence :</b> ce service innovant vous permet de vous entretenir à distance, sur Rendez-Vous, en visuel et à partir de chez vous, avec un chargé d’information de conseil au sujet des dossiers vous concernant.\r\n<br /><br />'),(3786,'ar','مرحبًا بكم في بوابة الاستقبال بموعد لدى الصندوق المغربي للتقاعد'),(3786,'fr','Bienvenue sur l\'application de prise de rendez-vous auprès de la Caisse Marocaine des Retraites.'),(3787,'ar','Administrateur Organisation CMR'),(3787,'fr','Administrateur Organisation CMR'),(3788,'ar','Administrateur Etablissement CMR'),(3788,'fr','Administrateur Etablissement CMR'),(3789,'ar','مسؤول نظام CMR'),(3789,'fr','Administrateur système CMR'),(3790,'ar','Opérateur Etablissement CMR'),(3790,'fr','Opérateur Etablissement CMR'),(3791,'ar','Admin'),(3791,'fr','Admin'),(3792,'ar','CMR'),(3792,'fr','CMR'),(3793,'ar','Jour férié'),(3793,'fr','Jour férié'),(3794,'ar','Jour de l\'an'),(3794,'fr','Jour de l\'an'),(3795,'ar','Manifeste de l\'Indépendance'),(3795,'fr','Manifeste de l\'Indépendance'),(3796,'ar','Fête du travail'),(3796,'fr','Fête du travail'),(3797,'ar','Fête du trône'),(3797,'fr','Fête du trône'),(3798,'ar','Allégeance Oued Eddahab'),(3798,'fr','Allégeance Oued Eddahab'),(3799,'ar','La Révolution du Roi et du peuple'),(3799,'fr','La Révolution du Roi et du peuple'),(3800,'ar','Fête de la jeunesse'),(3800,'fr','Fête de la jeunesse'),(3801,'ar','La marche verte'),(3801,'fr','La marche verte'),(3802,'ar','Fête de l\'Indépendance'),(3802,'fr','Fête de l\'Indépendance'),(3803,'ar','شارع الكولونيل حبوها ولد لعبيد - لعيون'),(3803,'fr','Avenue Colonel Habouha, Ouald Laâbid-Lâayoune '),(3804,'ar','المندوبية الجهوية بالعيون'),(3804,'fr','Délégation Régionale de Lâayoune'),(3805,'ar',''),(3805,'fr',''),(3806,'ar','حي الرياض، شارع العرعار - الرباط'),(3806,'fr','Hay Riad, Avenue ALARAAR - Rabat'),(3807,'ar','Visio Accueil'),(3807,'fr','Visio Accueil'),(3808,'ar',