rendez-vous dans le siège du département avec l’entité chargée du traitement de votre requête ;\r\n<br /><br />\r\n-             à distance: ce service vous permet de vous entretenir sur Rendez-Vous, par Visio conférence avec un représentant de l’entité chargée du traitement de votre requête.'),(4812,'ar','مرحبا بكم في بوابة أخذ المواعيد لدى قطاع إصلاح الإدارة'),(4812,'fr','Bienvenue sur l\'application de prise de rendez-vous auprès du Département de la Réforme de l’Administration '),(4813,'ar','Administrateur Organisme'),(4813,'fr','Administrateur Organisme'),(4814,'ar','Boukhani'),(4814,'fr',' Boukhani'),(4815,'ar','Mohamed'),(4815,'fr','Mohamed'),(4816,'ar','زاوية شارع النخيل وشارع المهدي بن بركة، عمارة ليباسيو، الطابق الثالث حي الرياض –الرباط المغرب'),(4816,'fr','Adresse : Angle Boulevard Annakhil et Avenue Mehdi ben Barka, Immeuble Les Patios, 3ème étage Hay Riad - Rabat Maroc'),(4817,'ar','اللجنة الوطنية لمراقبة حماية المعطيات ذات الطابع الشخصي'),(4817,'fr','Commission Nationale de Contrôle de Protection des Données à Caractère Personnel'),(4818,'ar','MSG'),(4818,'fr','MSG'),(4819,'ar',''),(4819,'fr','www.cndp.ma/'),(4820,'ar',''),(4820,'fr',''),(4821,'ar',''),(4821,'fr',''),(4822,'ar','MSG'),(4822,'fr','MSG'),(4823,'ar','مرحبا بكم في بوابة أخذ المواعيد لدى اللجنة الوطنية لمراقبة حماية المعطيات ذات الطابع الشخصي\r\n'),(4823,'fr','Bienvenue sur l\'application de prise de rendez-vous auprès de la Commission Nationale de Contrôle de Protection des Données à Caractère Personnel'),(4824,'ar','admin.cndp'),(4824,'fr','admin.cndp'),(4825,'ar','البكري'),(4825,'fr','EL BEKRI'),(4826,'ar','محمد'),(4826,'fr','Mohamed'),(4827,'ar',' عاطفي '),(4827,'fr','ATIFY '),(4828,'ar','عبد السلام'),(4828,'fr','Abdeslam'),(4829,'ar','البوعزاوي '),(4829,'fr','EL BOUAZZAOUI '),(4830,'ar','سعيد '),(4830,'fr','Said '),(4831,'ar','سبعاوي '),(4831,'fr','SEBAAOUI '),(4832,'ar','سعيد '),(4832,'fr','Said  '),(4833,'ar','زروالي وارتي  '),(4833,'fr','ZEROUALI OUARITI '),(4834,'ar','امال '),(4834