ي يمكن من: \r\n- حجز المواعيد عن بعد: يمكنكم من أخذ موعد مسبق مع ممثل للمصلحة التي تودون زيارتها من أجل الاستعلام، إيداع أو معالجة ملفاتكم، وكذلك سحب رخصكم وسنداتكم وذلك في الأوقات التي تناسبكم.<br /><br />\r\n- الاستقبال عن بعد : يمكنكم من خلاله التواصل عن بعد، عبر تقنية الفيديو، مع ممثل عن المصلحة المعنية بملفكم دون الحاجة للتنقل. <br /><br />\r\nهدفنا حسن استقبالكم، ساهموا معنا عبر الحجز المسبق لموعد زيارتكم، اختاروا الاستقبال عن بعد ولا تتنقلوا إلا للضرورة.<br /><br />\r\n</b>'),(5026,'fr','Dans le cadre de sa politique de digitalisation, et afin d’améliorer les conditions d’accueil de ses usagers, la Direction Générale de l’Aviation Civile a mis en place cette plate-forme qui permet : \r\n<br /><br /><b>- La prise des Rendez-Vous en ligne</b> avant de vous déplacer aux locaux de la DGAC pour toute nature de prestation : Demande de reseignements, Dépôt de dossiers, Retrait de titres ou autres. Cela vous garantira la disponibilité d’un représentant de l’administration pour prendre en charge votre requête et selon des horaires que vous choisirez vous-même. \r\n<br /><br /><b>- Le Télé-accueil</b> qui vous permet d’effectuer, sur Rendez-Vous, des entretiens ou des séances de travail en visioconférence avec la personne concernée de la DGAC sans avoir à vous déplacer.\r\n<br /><br /><b>Aidez nous à vous recevoir correctement. Ne vous déplacez que si cela est nécessaire. Pensez à prendre votre Rendez-Vous à l’avance.</b>\r\n'),(5027,'ar','مرحبا بكم في بوابة أخذ المواعيد لدى المديرية العامة للطيران المدني'),(5027,'fr','Bienvenue sur l\'application de prise de rendez-vous auprès de la Direction Générale de l\'Aviation Civile'),(5028,'ar','Administrateur Organisme'),(5028,'fr','Administrateur Organisme'),(5029,'ar','Admin Aviation Civile'),(5029,'fr','Admin Aviation Civile'),(5030,'ar','Admin Aviation Civile'),(5030,'fr','Admin Aviation Civile'),(5031,'ar','شارع الزيتون، حي الرياض، الرباط     '),(5031,'fr','Avenue Azzaitoune, Hay Riyad, Rabat'),(5032,'ar','المديرية العام